import React from 'react';
import Navebar from './components/Navbar';
import Content from './components/content';
import './App.css'
import Footer from './components/Footer';
import NetflixSVG from './SVGs/netflix.svg'

function App() {
  return (
    <div className="App">
      <Navebar />
      <img src={NetflixSVG} alt="netflix svg"/>
      <Footer />
    </div>
  );
}

export default App;
